import React, { Component } from "react";

class ListadeTareas extends Component {

    render() {
        return (
            <div>
                <h4>* Learn React</h4>
                <h4>* Cimb Mt. Everest</h4>
                <h4>* Run a marathon</h4>
                <h4>* Feed the dogs</h4>
            </div>
        )
    }
};

export default ListadeTareas;
